  return (
    <BrowserRouter>
      <div className="App">
        <div>
          <Header></Header>
        </div>

        <Routes>
          <Route path="/"></Route>
          <Route path="/"></Route>
          <Route path="/"></Route>
          <Route path="/"></Route>
          <Route path="/"></Route>
        </Routes>

        <Trends></Trends>
      </div>
    </BrowserRouter>
  );
}

export default App;
